  return (
    <BrowserRouter>
      <div className="App">
        {/* <Mainpage /> */}
        <Routes>
          <Route path="/" element={<Mainpage />} />
          <Route pather="/contact" element={<Contact />} />
        </Routes>

      </div>

    </BrowserRouter>

  );
}

export default App;
